import React, { useEffect } from "react";
import { PowerBIEmbed } from "powerbi-client-react";
import {
  service,
  factories,
  models,
  IEmbedConfiguration,
} from "powerbi-client";
import * as config from "../config";

const PowerBI = () => {
  useEffect(() => {
    console.log(config.reportId);
  }, []);

  const getEmbedUrl = () => {
    const res = fetch(
      "https://api.powerbi.com/v1.0/myorg/groups/" +
        config.workspaceId +
        "/reports/" +
        config.reportId,
      {
        headers: {
          Authorization: "Bearer " + accessToken,
        },
        method: "GET",
      }
    );
  };
  return (
    <div
      style={{
        height: "400px",
      }}
    >
      <PowerBIEmbed
        embedConfig={{
          type: "report",
          id: config.reportId,
          embedUrl:
            "https://app.powerbi.com/reportEmbed?reportId=af1e3172-bec8-4ce4-98f3-bee955673a41&config=eyJjbHVzdGVyVXJsIjoiaHR0cHM6Ly9XQUJJLUlORElBLUNFTlRSQUwtQS1QUklNQVJZLXJlZGlyZWN0LmFuYWx5c2lzLndpbmRvd3MubmV0IiwiZW1iZWRGZWF0dXJlcyI6eyJ1c2FnZU1ldHJpY3NWTmV4dCI6dHJ1ZX19",
          accessToken:
            "eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiIsIng1dCI6Ii1LSTNROW5OUjdiUm9meG1lWm9YcWJIWkdldyIsImtpZCI6Ii1LSTNROW5OUjdiUm9meG1lWm9YcWJIWkdldyJ9..Qu_MeilVWwejTZQQb1LxAB5_U7qcwFoLoAW2RS6pKg-yGPIhP-8-Wlr618bMX57fprxp_ctceNdVB6y4PFwMBpVQk9BjnlBjny01CyuR6JAtEGZhn-8Ncbr5XGiP3tcfwztBWSmDXm7UZAPf1DSnpzPy1fzuuaD02bGLUZ_twdbdYYoLND-uNkAOy66kyeJEKxhXrxka21r16mwdGzqwJ-J4n-0keZX15AgtCZFSyUZSlQJrI4NHDcmGwKrNKCaUzJ0rDeArlhUz6kwHH9fDT33yCxC8_LpY2F8TDWwtDRQS-NJfdQoWj1Bbw4-cM2IOmav0__yM70-NHeR0_3pJ4A",

          tokenType: models.TokenType.Aad,
          settings: {
            panes: {
              filters: {
                expanded: false,
                visible: true,
              },
            },
            background: models.BackgroundType.Transparent,
          },
        }}
        eventHandlers={
          new Map([
            [
              "loaded",
              function () {
                console.log("Report Loaded");
              },
            ],
            [
              "rendered",
              function () {
                console.log("Report Loaded");
              },
            ],
            [
              "error",
              function (event) {
                console.log(event.detail);
              },
            ],
          ])
        }
        cssClassName={"report-container"}
        getEmbeddedComponent={(embeddedReport) => {
          window.report = embeddedReport;
        }}
      ></PowerBIEmbed>
    </div>
  );
};

export default PowerBI;
